        private static string GetId(ref int i)
        {
            string s = String.Format("p{0}", i);
            i++;
            return s;
        }

        private static string GetCoordId(string baseId)
        {
            return String.Format("coord", baseId);
        }
        
        private static string GetPlacemarkId(string baseId)
        {
            return String.Format("pm", baseId);
        }

        private static string GetInfoId(string baseId)
        {
            return String.Format("info", baseId);
        }

        private static string GetPointInfo(TtPoint point, bool adj)
        {
            StringBuilder sb = new StringBuilder();

            sb.AppendFormat("<div>Point: {0}<br>Polygon: {1}<br><br>Operation: {2}<br><br>", point.PID, point.PolyName, point.op.ToString());
            sb.AppendFormat("<div>UtmX: {0}<br>UtmY: {1}</div><br>", (adj)?(point.AdjX):(point.UnAdjX), (adj)?(point.AdjY):(point.UnAdjY));
            sb.AppendFormat("<div>{0}</div>", point.Comment);

            return sb.ToString();
        }
    }
